import React from "react";
import Carousel, { consts } from 'react-elastic-carousel';
import Card from "./card";


const FleetSlider = ({fleets}) => {
  function myArrow({ type, onClick, isEdge }) {

    return (
      type === consts.PREV ?
        <button onClick={onClick} className="rec rec-arrow rec rec-arrow-left" disabled={isEdge} type="button"></button>
        :
        <button onClick={onClick} className="rec rec-arrow rec rec-arrow-right" disabled={isEdge} type="button"></button>
    )
  }
  return (
      <Carousel renderArrow={myArrow} itemsToShow={3} itemPadding={[25, 0]} transitionMs={700}>
        {fleets.map((fleet) => (
          <Card key={fleet.name} fleet={fleet} />
        ))}
      </Carousel>
  );
};

export default FleetSlider;
